Kellogg Company is one of the leading cereal and snack food manufacturers and distributors throughout the world. The company produces foods, such as cereal and convenience foods, including cookies, crackers, toaster pastries, cereal bars, frozen waffles, meat alternatives and cones. Kellogg products are manufactured in approximately 19 countries and marketed in more than 160 countries throughout the world. The company has developed and marketed some of the most popular brands and advertising characters in America. Kellogg Company has brand names, such as Kellogg s, Keebler, Pop-Tarts, Eggo, Cheez-It, Nutri-Grain, Rice Krispies and Special K. The company was founded in 1906 and has projected annual sales of more than $9 billion. Kellogg Company
